/** @format */
export const cardTransition = {
  duration: 1,
};
export const cardAnimation = {
  hidden: {
    y: 25,
    opacity: 0,
    scale: 0,
  },
  show: { y: 0, opacity: 1, scale: 1 },
};
export const ImageTextTransition = {
  delay: 0.6,
  duration: 0.7,
};
